import React from "react";

import { Link } from "react-router-dom";
import { useSelector } from "react-redux";

function Main() {
  let StationIdData = useSelector((state) => state.StationNameData.stationId);

  return (
    <main>
      <h1>대전 지하철 NOW</h1>
      <span>당신은 지하철을 탈 수 있을까요?</span>
      {StationIdData.map((e, i) => (
        <StationList key={i} StationIdData={StationIdData[i]} i={i+101} />
      ))}
    </main>
  );
}

function StationList(props) {
  return (
    <>
      <ul>
        <li>
          <Link to={`arrivalinfo/`+props.i}> {props.StationIdData.name} </Link>
        </li>
      </ul>
    </>
  );
}

export default Main;
